import React from "react";
import userData from "../User Data/userData";

const Card = (userData) => {
  const data = userData.data;
  console.log(data);

  const mack = data.map((list) => {
    return (
      <>
        <div className="card-container">
          <div className="name-container">
            <p>{list.name}</p>
          </div>
        </div>
      </>
    );
  });

  return mack;
};

export default Card;
